import { Container, Row, Col } from 'react-bootstrap';
import '../css/investMore.css';

export default function InvestMore() {
    return (
        <>
            <Container fluid className="text-left mt-3">
                <Row>
                    <Col>
                        <h2 className="heading">Best Investments Options In India</h2>
                        <p className="heading">Regardless of your risk appetite, it is important to choose the right instruments to grow yur savings. To help you plan where to invest, here's a look at the top 10 investment instruments choosen by investors in India.</p>
                        <ul>
                            <li><b>Stocks : </b> </li>
                        </ul>
                    </Col>
                </Row>
            </Container>
        </>
    );
}
